import Head from 'next/head';

export default Layout = (props) => (
    <div>
        <Head>
            <title>Bud Smith Portfolio</title>
            <link rel="icon" href="/favicon.ico" />
            <link rel="stylesheet" href="https://bootswatch.com/4/slate/bootstrap.min.css" />
        </Head>
        {props.children}
    </div>
);
